import React, { useState } from 'react';
import { Calendar as CalendarIcon } from 'lucide-react';
import DatePicker from 'react-multi-date-picker';

const AdminCalendar = () => {
  const [selectedDates, setSelectedDates] = useState([]);
  const [message, setMessage] = useState('');

  const handleDateChange = (dates) => {
    setSelectedDates(dates);
    setMessage('');
  };

  const handleSaveDates = () => {
    setMessage('Dates saved successfully!');
  };

  // Custom styles to match the image design
  const customStyles = {
    calendar: {
      width: '100%',
      height: 'max-content',
      padding: '20px',
      background: 'white',
      border: 'none',
      borderRadius: '0 0 8px 8px',
      fontFamily: 'inherit',
    },
    header: {
      padding: '10px',
      margin: '-20px -20px 20px -20px',
      background: 'white',
    },
    heading: {
      fontSize: '1.5rem',
      fontWeight: '600',
    },
    day: {
      width: '40px',
      height: '40px',
      margin: '4px',
      color: 'black',
      background: 'rgb(243 244 246)',
      borderRadius: '0',
      fontSize: '1rem',
    },
    today: {
      background: 'rgb(243 244 246)',
      color: 'black',
      border: 'none',
    },
    selected: {
      background: 'rgb(254 202 202)',
      color: 'black',
    },
    weekDays: {
      fontSize: '1rem',
      color: 'black',
      fontWeight: '500',
    },
  };

  return (
    <div className="w-full max-w-4xl mx-auto">
      <div className="bg-blue-600 text-white p-4 rounded-t-lg flex items-center gap-2">
        <CalendarIcon className="w-6 h-6" />
        <span className="text-lg">Calendar</span>
      </div>

      <DatePicker
        value={selectedDates}
        onChange={handleDateChange}
        multiple
        format="MMMM YYYY"
        style={customStyles.calendar}
        calendarPosition="bottom-center"
        containerClassName="w-full"
        headerFormat="MMMM YYYY"
        minDate={new Date()}
        classNames={{
          header: 'custom-header',
          day: 'custom-day',
          selected: 'custom-selected',
        }}
        renderButton={(open) => (
          <div className="bg-white p-6 flex justify-between items-center">
            <button className="px-4 py-2 bg-gray-800 text-white rounded">Previous</button>
            <h2 className="text-2xl font-semibold">November 2024</h2>
            <div className="w-20"></div>
          </div>
        )}
      />

      {selectedDates.length > 0 && (
        <div className="mt-6 p-4 bg-blue-50 rounded-md">
          <h3 className="text-blue-800 font-semibold mb-2">Selected Dates:</h3>
          <ul className="space-y-1">
            {selectedDates.map((date, index) => (
              <li key={index} className="flex items-center gap-2 text-blue-700">
                <CalendarIcon className="w-4 h-4" />
                {date.format("dddd, MMMM D, YYYY")}
              </li>
            ))}
          </ul>
          <button
            onClick={handleSaveDates}
            className="mt-4 px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
          >
            Save Dates
          </button>
          {message && (
            <p className="mt-2 text-green-600">
              {message}
            </p>
          )}
        </div>
      )}

      <style jsx global>{`
        .custom-header {
          ${Object.entries(customStyles.header).map(([key, value]) => `${key}: ${value};`).join('\n')}
        }
        .custom-day {
          ${Object.entries(customStyles.day).map(([key, value]) => `${key}: ${value};`).join('\n')}
        }
        .custom-selected {
          ${Object.entries(customStyles.selected).map(([key, value]) => `${key}: ${value};`).join('\n')}
        }
        .rmdp-week-day {
          ${Object.entries(customStyles.weekDays).map(([key, value]) => `${key}: ${value};`).join('\n')}
        }
        .rmdp-header-values {
          ${Object.entries(customStyles.heading).map(([key, value]) => `${key}: ${value};`).join('\n')}
        }
        .rmdp-wrapper {
          border: none !important;
        }
      `}</style>
    </div>
  );
};

export default AdminCalendar;
